import {takeLatest} from "redux-saga/effects";
import * as types from "../actions/actionTypes";
import { 
    getFilesSaga,
    initGoogleSignIn,
    startGoogleSignIn,
    getRedirectUrlSaga,
    authenticateUserSaga,
} from "./sagas";

export const watchSagas = function*() {
    yield takeLatest(types.GET_FILES, getFilesSaga);
    yield takeLatest(types.INIT_GOOGLE_SIGNIN, initGoogleSignIn);
    yield takeLatest(types.START_GOOGLE_SIGNIN, startGoogleSignIn);
    yield takeLatest(types.CHECK_SIGNIN, getRedirectUrlSaga);
}
